import React, { useState } from 'react';
import SearchItems from './SearchItems';

function InputTable(props) {
  const { input1, setInput1, input2, setInput2, tableData } = props;
  const [inState, setInState] = useState(true);

  const handleSubmit = (e) => {
    e.preventDefault();
    props.onSubmit({ input1, input2 });
    setInput1("");
    setInput2("");
  };

  const handleInStateChange = () => {
    setInState(true);
  };

  const handleOutOfStateChange = () => {
    setInState(false);
  };

  return (
    <div>
      <div className="input-table-container">
        <h1 className="my-header">University ROI Calculator</h1>
        <h2 className="my-subheader">Find and Compare the value in your Education</h2>
        <SearchItems input1={input1} setInput1={setInput1} input2={input2} setInput2={setInput2} handleSubmit={handleSubmit} />
        <div style={{ display: "flex", alignItems: "center" }}>
          <label style={{ margin: "10px" }}>
            <input type="radio" value="in-state" checked={inState} onChange={handleInStateChange} />
            In-State
          </label>
          <label style={{ margin: "10px" }}>
            <input type="radio" value="out-of-state" checked={!inState} onChange={handleOutOfStateChange} />
            Out-of-State
          </label>
        </div>
        <table>
          <thead>
            <tr>
              <th>College</th>
              <th>Major</th>
              <th>In/Out State</th>
              <th colspan="2">Cost of attendance</th>
              <th colspan="3">Median Salary</th>
            </tr>
            <tr>
              <th></th>
              <th></th>
              <th></th>
              <th>1 yr.</th>
              <th>4 yrs.</th>
              <th>6 yrs.</th>
              <th>3 yrs.</th>
              <th>1 yr.</th>
            </tr>
          </thead>
          <tbody>
            {tableData.map((data, index) => (
              <tr key={index}>
                <td>{data.input1}</td>
                <td>{data.input2}</td>
                <td>{inState ? "IN" : "OUT"}</td>
                <td>{"Cost xxx"}</td>
                <td>{"Cost xxx"}</td>
                <td>{"Salary xxx"}</td>
                <td>{"Salary xxx"}</td>
                <td>{"Salary xxx"}</td>
              </tr>
            ))}
          </tbody>
        </table>
      </div>
      <div className="text-container">
        <h3 style={{ fontSize: '30px' }}>About this Calculator</h3>
        <p>
          This tool provides data of cost of attendance and median salary of 
          post graduates for specific college majors. This data is based on 
          national information of in-state and out of state tuition, as well
          as 1, 3, and 6 year graduates from the college programs.
        </p>
      </div>
    </div>
  );
}

export default InputTable;
